                FROM tb_tcheckdisbursementdtl) b
                ON a.CDID_cd = b.CDID_cd

                WHERE   YEAR(a.CDDate_dt) <= mYear1 AND MONTH(a.CDDate_dt) <= mMonth1  AND a.Post_yn = '1'





                UNION





                SELECT  a.CDID_cd AS 'ControlID_cd',
                        a.CDDate_dt AS 'ControlDate_dt',
